function get_range(e,t){return document.get_range(e,t)}function get_range_as_csv(e,t){return document.get_range(e,t).toString()}function get_range_as_text_array(e,t){return"["+document.get_range(e,t).toString()+"]"}function get_range_as_array(e,t){return document.get_range(e,t).toString().split(",")}function get_column(e,t){return document.get_column(e,t)}function get_column_as_text(e,t){return document.get_column(e,t).toString()}function set_range(e,t,n){return document.set_range(e,t,n)}function search_column(e,t,n){return document.search_column(e,t,n)}function search_column_index(e,t,n){return document.search_column_index(e,t,n)}function get_tags(){return document.get_tags()}function button_set_range(){var e=get_range("script_values","c2");var t=get_range("script_values","d2");var n=get_range("script_values","e2").toString().split(",");set_range(e,t,n)}function Document(){this.document=SpreadsheetApp.getActiveSpreadsheet();this.name=SpreadsheetApp.getActiveSpreadsheet().getActiveSheet().getName();this.set_cell=function(e,t,n){return SpreadsheetApp.getActiveSpreadsheet().getSheetByName(e).getRange(t).setValue(n)}}Document.prototype.clean_array=function(e){var t=e.filter(function(e){return e});t=t.toString().replace(/\,{2,}/gi,",");t=t.replace(/\,$/,"");return t.split(",")};Document.prototype.get_column=function(e,t){return SpreadsheetApp.getActiveSpreadsheet().getSheetByName(e).getRange(t+":"+t).getValues()};Document.prototype.get_range=function(e,t){return SpreadsheetApp.getActiveSpreadsheet().getSheetByName(e).getRange(t).getValues()};Document.prototype.get_tags=function(){var e=SpreadsheetApp.getActiveSpreadsheet().getActiveSheet().getDataRange().getValues();return document.clean_array(e)};Document.prototype.sheet=function(e){return this.document.getSheetByName(e)};Document.prototype.get_sheet=function(e){return this.document.getSheetByName(e).activate()};Document.prototype.search_column=function(e,t,n){var r=SpreadsheetApp.getActiveSpreadsheet().getSheetByName(e);var a=r.getRange(t+":"+t);var u=a.getValues().toString().split(",");u=u.filter(function(e){return e});if(u.indexOf(n)>-1){return"yes"}else{return"no"}};Document.prototype.search_column_index=function(e,t,n){var r=SpreadsheetApp.getActiveSpreadsheet().getSheetByName(e);var a=r.getRange(t+":"+t);var u=a.getValues().toString().split(",");u=u.filter(function(e){return e});var u=a.getValues();var o=0;while(u[o]&&u[o][0]!==n){o++}var c;try{if(u[o][0]===n){c=o+1}else{c=-1}}catch(g){c="none"}if(c>0){return t+c}else{return c}};Document.prototype.set_range=function(e,t,n){return SpreadsheetApp.getActiveSpreadsheet().getSheetByName(e).getRange(t).setValues([n])};var document=new Document;function read_data(){var e=document.sheet("display");var t=document.get_range("display","a2:d2");var n=t.toString().split(",");document.set_range("display","a10:d10",n)}function ui_prompt(e){return SpreadsheetApp.getUi().prompt(e)}